const Card = (props, {children})=>{

    return(

        <div className='container'>
            <p>Name:{props.name}</p>
            <p className='films'>Films:{props.films}</p>
            <p>Birth:{props.birth_year}</p>
            <p>{props.title}</p>
            <p>{props.director} </p>
         <p>{props.release_date} 
</p>

          <p>{props.species}
</p>
        {children}
        </div>
    )

}

export default Card;
